import React from 'react';
import chat_navbar from './chat_navbar'
import Search from './Search'



const Sidebar = () => {
  return (
    <div className="Sidebar">
      <div className="container">
          <chat_navbar/>
          <Search/>
          </div>
    </div>
  )
}

export default Sidebar
